ю с наступающим праздником. Вы всегда на страже здоровья, и всегда готовы прийти на помощь! Вы дарите надежды на спасение, и помогаете обрести уверенность в своих силах. Вы помогаете в трудных ситуациях и своим профессионализмом даете шанс на счастье! Вам можно доверить сокровенное и поделиться очень личным. Вы - надежные собеседники и мудрые наставники. Вы - тактичные, сдержанные, уверенные, внимательные, подтянутые, всегда в отличной форме! Оставайтесь всегда такими! Будьте счастливы и любимы! Будьте здоровы! И пусть ваша профессия дарит вам много радостных минут и вдохновения! А в ваших семьях царит мир, добро и благополучие! Спасибо вам, дорогие врачи! Настоящие мужчины с большой буквы! С праздником!";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23543:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23543:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23543:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23543:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23543:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23267;a:24:{s:2:"ID";s:5:"23267";s:11:"ACTIVE_FROM";s:19:"4 ноября 2009";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:8:"Алия";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23267:21";s:20:"PROPERTY_EMAIL_VALUE";s:12:"mcrm@mcrm.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23267:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23267:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:584:"Здравствуйте!Очень хотелось бы,что бы на вашем сайте было больше информации о самой процедуре ЭКО.Что такое короткий протокол и длинный и в каком случае выбирают тот или иной способ?.Список анализов которые нужно подготовить?Мы с мужем собираемся к вам в клинику на ЭКО.Можно ли сдать все ан